import React from "react";
import ReactDOM from "react-dom/client";
import "./App.css";

function Button() {
  let count = 0;
  const handleClick = (e) => {
    e.target.textContent = "ouc";
  };
  return (
    <>
      <button onClick={(e) => handleClick(e)}>Click Me</button>
    </>
  );
}

function App() {
  return (
    <>
      <Button />
    </>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
